--********** 5. Script SQL per la creazione dello
--           schema logico *****************************

create schema "OCA";
set search_path to "OCA";
set datestyle to "MDY";

-- Relazioni del carico di lavoro:
-- Gioco, GiocoInfo, Sfida, SfidaInfo
 
CREATE TABLE SetIcone (
Nome varchar(20) PRIMARY KEY,
Larghezza SMALLINT NOT NULL,
Altezza SMALLINT NOT NULL
);

CREATE TABLE GameCreator (
Id SERIAL PRIMARY KEY
);

--#tuple:3000 , #blocchiDisco:70
CREATE TABLE GiocoInfo (
Id SERIAL PRIMARY KEY,
Sfondo text NOT NULL,
TempoRisposta time NOT NULL,
NomeSet varchar(20) NOT NULL REFERENCES SetIcone (Nome) ON UPDATE CASCADE,
Creatore INT NOT NULL REFERENCES GameCreator (Id) ON UPDATE CASCADE 
);

--#tuple:3000 , #blocchiDisco:14
CREATE TABLE Gioco(
GiocoId INT PRIMARY KEY REFERENCES GiocoInfo(Id) ON UPDATE CASCADE,
NrDadi SMALLINT NOT NULL,
MaxSquadre SMALLINT NOT NULL
);


CREATE TABLE Admin(
Id SERIAL PRIMARY KEY
);


--#tuple:1999 , #blocchiDisco:17
CREATE TABLE SfidaInfo(
Id SERIAL PRIMARY KEY,
Orario time NOT NULL,
DurataEffettiva time,
NrSquadre SMALLINT NOT NULL,
NrDadiPartenza SMALLINT NOT NULL,
Moderata boolean NOT NULL,
Attivatore INT NOT NULL REFERENCES Admin(Id) ON UPDATE CASCADE,
Validatore INT NOT NULL REFERENCES Admin(Id) ON UPDATE CASCADE
);

--#tuple:1999 , #blocchiDisco:13
CREATE TABLE Sfida(
SfidaId INT PRIMARY KEY REFERENCES SfidaInfo(Id) ON UPDATE CASCADE,
GiocoId INT NOT NULL REFERENCES Gioco(GiocoId) ON UPDATE CASCADE,
Data date NOT NULL,
DurataMassima time NOT NULL
);


CREATE TABLE Squadra(
Nome varchar(20) PRIMARY KEY
);

CREATE TABLE Icona(
Nome varchar(20),
NomeSet varchar(20) REFERENCES SetIcone(Nome) ON UPDATE CASCADE,
Larghezza SMALLINT NOT NULL,
Altezza SMALLINT NOT NULL,
PRIMARY KEY(Nome, NomeSet)
);

CREATE TABLE Segnaposto(
Squadra varchar(20) REFERENCES Squadra(Nome) ON UPDATE CASCADE,
SfidaId INT REFERENCES SfidaInfo(Id) ON UPDATE CASCADE,
NomeIcona varchar(20), 
NomeSet varchar(20),
FOREIGN KEY(NomeIcona, NomeSet) REFERENCES Icona (Nome, NomeSet) ON UPDATE CASCADE,
X SMALLINT NOT NULL,
Y SMALLINT NOT NULL,
PRIMARY KEY(Squadra, SfidaId),
UNIQUE(SfidaId, NomeIcona, NomeSet)
);

CREATE TABLE OttienePunteggio(
Squadra varchar(20) REFERENCES Squadra(Nome) ON UPDATE CASCADE,
SfidaId INT REFERENCES SfidaInfo(Id) ON UPDATE CASCADE,
PunteggioCorrente SMALLINT NOT NULL,
PunteggioFinale SMALLINT,
PRIMARY KEY (Squadra, SfidaId)
);

CREATE TABLE Utente(
Nickname varchar(20) PRIMARY KEY,
Email varchar(20) UNIQUE,
Nome varchar(20),
Cognome varchar(20),
DataNascita date
);

CREATE TABLE UtentePartecipa(
Nickname varchar(20) REFERENCES Utente(Nickname) ON UPDATE CASCADE,
Squadra varchar(20) REFERENCES Squadra(Nome) ON UPDATE CASCADE,
SfidaId INT REFERENCES SfidaInfo(Id) ON UPDATE CASCADE,
Ruolo varchar(20) NOT NULL CHECK(Ruolo IN ('giocatore', 'coach', 'caposquadra')),
PRIMARY KEY(Nickname, Squadra, SfidaId)
);

