CREATE TABLE CasellaNumerica(
Numero SMALLINT,
GiocoId INT REFERENCES GiocoInfo(Id) ON UPDATE CASCADE,
X SMALLINT NOT NULL,
Y SMALLINT NOT NULL,
Tipo varchar(20) NOT NULL CHECK(Tipo IN ('normale', 'serpente', 'scala')),
NumeroCasellaDest SMALLINT,
GiocoCasellaDest INT,
FOREIGN KEY(NumeroCasellaDest, GiocoCasellaDest) REFERENCES CasellaNumerica(Numero, GiocoId) ON UPDATE CASCADE,
Video text,
DurataVideo time CHECK (DurataVideo BETWEEN '00:00:30' AND '00:01:30'),
PRIMARY KEY(Numero, GiocoId),

CONSTRAINT destStessoGioco CHECK (
    NumeroCasellaDest IS NULL OR (GiocoCasellaDest IS NOT NULL AND GiocoId=GiocoCasellaDest)
),
CONSTRAINT serpenteDestMinore CHECK (
    Tipo != 'serpente' OR (NumeroCasellaDest IS NOT NULL AND NumeroCasellaDest < Numero)
),
CONSTRAINT scalaDestMaggiore CHECK (
    Tipo != 'scala' OR (NumeroCasellaDest IS NOT NULL AND NumeroCasellaDest > Numero)
),
CONSTRAINT normaleDestNulla CHECK( 
    Tipo != 'normale' OR (NumeroCasellaDest IS NULL AND  GiocoCasellaDest IS NULL) 
),
CONSTRAINT siVideo CHECK (
    Video IS NULL OR (DurataVideo IS NOT NULL)
),
CONSTRAINT noVideo CHECK (
    Video IS NOT NULL OR (DurataVideo IS NULL)
)
);
