CREATE TABLE Turno(
Numero SMALLINT,
Squadra varchar(20) REFERENCES Squadra(Nome) ON UPDATE CASCADE,
SfidaId INT REFERENCES SfidaInfo(Id) ON UPDATE CASCADE,
VisitaCasellaNumero SMALLINT NOT NULL,
VisitaCasellaGioco INT NOT NULL,
FOREIGN KEY(VisitaCasellaNumero, VisitaCasellaGioco) REFERENCES CasellaNumerica(Numero, GiocoId) ON UPDATE CASCADE,
PunteggioOttenuto SMALLINT NOT NULL,
PunteggioLancio SMALLINT,
NumeroCorrenteDadi SMALLINT NOT NULL,
Tempo time NOT NULL,
PRIMARY KEY(Numero, Squadra, SfidaId)
);

CREATE TABLE Task(
Id SERIAL PRIMARY KEY,
Testo text NOT NULL,
Punteggio SMALLINT NOT NULL,
NumeroCasella SMALLINT NOT NULL,
GiocoCasella INT NOT NULL,
FOREIGN KEY(NumeroCasella, GiocoCasella) REFERENCES CasellaNumerica(Numero, GiocoId) ON UPDATE CASCADE
);



